import React, { useState } from 'react';
import '../styles/Dashboard.css';

function DashboardPage() {
  const [searchQuery, setSearchQuery] = useState('');
  const [activeFilter, setActiveFilter] = useState('Ï†ÑÏ≤¥');

  // ÏûÑÏãú Îç∞Ïù¥ÌÑ∞
  const recipes = [
    {
      id: 1,
      title: 'ÍπÄÏπòÏ∞åÍ∞ú',
      time: '30Î∂Ñ',
      difficulty: 'Ïâ¨ÏõÄ',
      emoji: 'üç≤',
      tags: ['Îß§Ïö¥Îßõ', 'Íµ≠/Ï∞åÍ∞ú'],
      favorite: true
    },
    {
      id: 2,
      title: 'ÌÜ†ÎßàÌÜ† ÌååÏä§ÌÉÄ',
      time: '25Î∂Ñ',
      difficulty: 'Ïâ¨ÏõÄ',
      emoji: 'üçù',
      tags: ['ÏñëÏãù', 'Î©îÏù∏'],
      favorite: false
    },
    {
      id: 3,
      title: 'Ïπ¥Î†àÎùºÏù¥Ïä§',
      time: '40Î∂Ñ',
      difficulty: 'Î≥¥ÌÜµ',
      emoji: 'üçõ',
      tags: ['ÏùºÏãù', 'Î©îÏù∏'],
      favorite: false
    },
    {
      id: 4,
      title: 'ÏãúÏ†Ä ÏÉêÎü¨Îìú',
      time: '15Î∂Ñ',
      difficulty: 'Ïâ¨ÏõÄ',
      emoji: 'ü•ó',
      tags: ['ÏÉêÎü¨Îìú', 'Í±¥Í∞ïÏãù'],
      favorite: true
    }
  ];

  const filters = ['Ï†ÑÏ≤¥', 'üçΩÔ∏è Î©îÏù∏ ÏöîÎ¶¨', 'ü•ó Î∞òÏ∞¨', 'üçú Íµ≠/Ï∞åÍ∞ú', 'üç∞ ÎîîÏ†ÄÌä∏', '‚ö° 30Î∂Ñ Ïù¥ÎÇ¥', 'üòä Ïâ¨ÏõÄ'];

  return (
    <div className="dashboard-container">
      {/* Ìó§Îçî */}
      <header className="dashboard-header">
        <div className="logo">üç≥ RecipeNote</div>
        <nav className="nav">
          <a href="/dashboard">ÎÇ¥ Î†àÏãúÌîº</a>
          <a href="/profile">ÌîÑÎ°úÌïÑ</a>
          <a href="/login">Î°úÍ∑∏ÏïÑÏõÉ</a>
        </nav>
      </header>

      {/* Î©îÏù∏ ÏΩòÌÖêÏ∏† */}
      <div className="dashboard-content">
        <div className="page-header">
          <h1 className="page-title">ÎÇ¥ Î†àÏãúÌîº</h1>
          <p className="page-subtitle">42Í∞úÏùò Î†àÏãúÌîºÎ•º Ï†ÄÏû•ÌñàÏñ¥Ïöî üéâ</p>
        </div>

        {/* ÌÜµÍ≥Ñ Ïπ¥Îìú */}
        <div className="stats-grid">
          <div className="stat-card">
            <div className="stat-value">42</div>
            <div className="stat-label">Ï†ÑÏ≤¥ Î†àÏãúÌîº</div>
          </div>
          <div className="stat-card">
            <div className="stat-value">12</div>
            <div className="stat-label">Ï¶êÍ≤®Ï∞æÍ∏∞</div>
          </div>
          <div className="stat-card">
            <div className="stat-value">8</div>
            <div className="stat-label">Ïù¥Î≤à Ï£º Ï∂îÍ∞Ä</div>
          </div>
        </div>

        {/* Í≤ÄÏÉâ Î∞î */}
        <div className="search-bar">
          <input
            type="text"
            className="search-input"
            placeholder="üîç Î†àÏãúÌîº, Ïû¨Î£å Í≤ÄÏÉâ..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          <button className="btn-search">Í≤ÄÏÉâ</button>
        </div>

        {/* ÌïÑÌÑ∞ */}
        <div className="filters">
          {filters.map((filter) => (
            <button
              key={filter}
              className={`filter-btn ${activeFilter === filter ? 'active' : ''}`}
              onClick={() => setActiveFilter(filter)}
            >
              {filter}
            </button>
          ))}
        </div>

        {/* Î†àÏãúÌîº Í∑∏Î¶¨Îìú */}
        <div className="recipe-grid">
          {recipes.map((recipe) => (
            <div key={recipe.id} className="recipe-card" onClick={() => window.location.href = '/recipe/1'}>
              <div className="recipe-image">
                {recipe.emoji}
                <div className="recipe-favorite">
                  {recipe.favorite ? '‚ù§Ô∏è' : 'ü§ç'}
                </div>
              </div>
              <div className="recipe-content">
                <div className="recipe-title">{recipe.title}</div>
                <div className="recipe-meta">
                  <span>‚è±Ô∏è {recipe.time}</span>
                  <span>üë§ {recipe.difficulty}</span>
                </div>
                <div className="tags">
                  {recipe.tags.map((tag) => (
                    <span key={tag} className="tag">{tag}</span>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* Î¨¥Ìïú Ïä§ÌÅ¨Î°§ Î°úÎî© */}
        <div className="loading-more" style={{ display: 'none' }}>
          <div className="spinner"></div>
          <p>Îçî ÎßéÏùÄ Î†àÏãúÌîºÎ•º Î∂àÎü¨Ïò§Îäî Ï§ë... üç≥</p>
        </div>
      </div>

      {/* FAB Î≤ÑÌäº */}
      <button className="fab" onClick={() => window.location.href = '/recipe/new'}>
        +
      </button>
    </div>
  );
}

export default DashboardPage;
